AOS.init();let eventDate=new Date("Oct 10, 2024 18:00:00"),eventTimeStamp=eventDate.getTime(),displayTimeElement=document.querySelector("#time_counter");setInterval(()=>{var e=(new Date).getTime(),e=eventTimeStamp-e,t=Math.floor(e/864e5),a=Math.floor(e%864e5/36e5),n=Math.floor(e%36e5/6e4),e=Math.floor(e%6e4/1e3);displayTimeElement.innerHTML=t+"d "+a+"h "+n+"m "+e+"s"},1e3);